import React from 'react';
import {connect} from "react-redux";
import {withRouter} from "react-router-dom"
import {compose} from "redux";
import {newItem} from "../../../../Redux/later-seen-reducer";
import AllOrder from "./AllOrder";


class AllOrderContainer extends React.Component {


    render() {
        debugger
        return (
            <div>
                <AllOrder
                    pizza={this.props.pizza[this.props.match.params.id] <= 13 ? this.props.pizza[0] : this.props.pizza[this.props.match.params.id - 1]}
                    number={this.props.match.params.id}
                    size={this.props.size} ves={this.props.ves} newItem={this.props.newItem}
                    drink={this.props.drink[this.props.match.params.id] >= 14 && this.props.drink[this.props.match.params.id] < 20 ? this.props.drink[0] : this.props.drink[this.props.match.params.id - 14]}
                    sneks={this.props.sneks[this.props.match.params.id] >= 20 && this.props.sneks[this.props.match.params.id] < 33 ? this.props.sneks[0] : this.props.sneks[this.props.match.params.id - 20]}
                />

            </div>

        )
    }
}


let mapStateToprops = (state) => {

    return {
        pizza: state.pizzaPage.pizza,
        size: state.pizzaPage.siza,
        ves: state.pizzaPage.ves,
        drink: state.drinkPage.drink,
        sneks: state.sneksPage.sneks,


    }


}

export default compose(
    connect(mapStateToprops, {newItem}),
    withRouter,
)(AllOrderContainer)
